const Locations = (props) => {
    return(
        <div>
            <hr/>
        <h3>{props.locations.name}</h3>
        <h3>{props.locations.type}</h3>
        <h3>{props.locations.dimension}</h3>
        </div>
    )
}

export  default Locations
